"use strict";(self.webpackChunkmagiquest_wiki=self.webpackChunkmagiquest_wiki||[]).push([[890],{8759:e=>{e.exports=JSON.parse('{"label":"Item","permalink":"/tags/item","allTagsPath":"/tags","count":4,"items":[{"id":"Info_About_MagiQuest/costumes","title":"Costumes","description":"Costumes can be purchased to add to the experience of playing MagiQuest. They are usually intended for younger players as most costumes only come in smaller sizes.","permalink":"/costumes"},{"id":"Info_About_MagiQuest/goldenkey","title":"Golden Key","description":"The Golden Key is a special item that can be used to unlock secret areas of the kingdom. This item can only be used at the Pigeon Forge, TN location but was at one point an item that could be used at the Myrtle Beach, SC location as well.","permalink":"/golden_key"},{"id":"Info_About_MagiQuest/kingdomcompass","title":"Kingdom Compass","description":"A Compass is an item that is used whenever playing Compass Quest. It functions in a similar way to a wand in which the player uses the compass to activate the various areas in the game. It also unlocks 9 additional quests the player can play through. The compass itself can open up similar to that of a real compass.","permalink":"/kingdom_compass"},{"id":"Info_About_MagiQuest/theancientbookofwisdom","title":"The Ancient Book of Wisdom","description":"The Ancient Book of Wisdom is a book of clues to objectives in a quest written in verses intended to aid the player when playing MagiQuest. All books are different depending on location and some have quests exclusive to that place.The book is usually given to players after purchasing the game and wand.","permalink":"/the_ancient_book_of_wisdom"}],"unlisted":false}')}}]);